private static Hashtable importFile(Hashtable myHashtable, String myFileName)\n{\n    StreamReader sr = new StreamReader(myFileName);\n    CSVReader csvReader = new CSVReader();\n    ArrayList tempArray = new ArrayList();\n    ArrayList duplicateKeys = new ArrayList(); // to store duplicate keys\n    int count = 0;\n\n    while (!sr.EndOfStream)\n    {\n        String temp = sr.ReadLine();\n        if (temp.StartsWith(" "))\n        {\n            ServMissing.Add(temp);\n        }\n        else\n        {\n            tempArray = csvReader.CSVParser(temp);\n            Boolean first = true;\n            String key = "";\n            String value = "";\n\n            foreach (String x in tempArray)\n            {\n                if (first)\n                {\n                    key = x;\n                    first = false;\n                }\n                else\n                {\n                    value += x + ",";\n                }\n            }\n\n            try\n            {\n                myHashtable.Add(key, value);\n            }\n            catch (ArgumentException)\n            {\n                duplicateKeys.Add(key); // add key to duplicate keys ArrayList\n            }\n        }\n        count++;\n    }\n\n    Console.WriteLine("Import Count: " + count);\n    Console.WriteLine("Duplicate Keys: " + duplicateKeys.Count);\n    return myHashtable;\n}